import React, { Component } from 'react';


class Far extends Component {
    state = { 
        name: "nasir",
        bttext: "I am a big button"
     };


    render() { 
        return ( 
        <div>
            <span>Hello {this.state.name}</span> 
            <button className="btn btn-outline-success btn-sm m-2">{this.state.bttext}</button>

            <container>
                <row className="justify-content-md-center">
                    <col xs lg="2">
                    1 of 3
                    </col>
                    <col md="auto">Variable width content</col>
                    <col xs lg="2">
                    3 of 3
                    </col>
                </row>
            </container>

        </div>
        );
    }
}

export default Far;
